import regex as re

str=""
motif="TGGGTTCTG"
pattern = re.compile(motif)
res = pattern.match(str)
print(res)
res2=pattern.search(str)
print(res2)
res3=pattern.findall(str)
print(res3)
res4=pattern.finditer(str,overlapped=True)
#print(next(res4))
#print(next(res4))
for i in res4:
    print((i).start()+1,end=" ")
